import { Bar } from 'react-chartjs-2';
import {
  Chart ,
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';


Chart.register(
  LinearScale,CategoryScale,BarElement
)
const labels = ['January', 'February', 'March', 'April', 'May', 'June', 'July'];

const data={
  labels,
  datasets:[
    {
      labels:'2020 Expen',
      data:[90000, 9000,8000 ,10200, 10500,8403,13000],
      backgroundColor:'pink'
    },
    {
      labels:'2020 Expen',
      data:[6000, 5000,3000 ,8200, 23500,9403,17000],
      backgroundColor:'pink'
    }
  ]
}
function Ccrusher(){
return (  <div>
    <Bar data={data}/>
  </div>)
}
export default Ccrusher;
